from pybricks.hubs import PrimeHub
from pybricks.parameters import Button, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor
from pybricks.robotics import DriveBase
from pybricks.tools import wait

# Set up all devices.
prime_hub = PrimeHub()
lineSensor = ColorSensor(Port.F)
elementSensor = ColorSensor(Port.C)
rightMotor = Motor(Port.E, Direction.CLOCKWISE)
leftMotor = Motor(Port.D, Direction.COUNTERCLOCKWISE)
clawMotor = Motor(Port.B, Direction.COUNTERCLOCKWISE)
backMotor = Motor(Port.A, Direction.CLOCKWISE)
driveBase = DriveBase(leftMotor, rightMotor, 62.4, 220)

# Initialize variables.
error = 0
correcion = 0
lineFollowSpeed = 60
elementX = 0
driveBaseSpeed = 200
defineCase = 0

